import useUsers from "../../store/user";

function User() {
    const { users, execute} =useUsers(state => state);
    console.log(process.env.NEXT_PUBLIC_API_KEY);
    return(
        <div>
            <button onClick={() => execute("https://jsonplaceholder.typicode.com/users")}> call api </button>
           <div>
               {users.map((user) =>{
                   return <div>{user.name}</div>
               })}
           </div>

        </div>
    )
}

export default  User;
